import React, { Component } from "react";
import Form from "react-validation/build/form";
import Input from "react-validation/build/input";
import CheckButton from "react-validation/build/button";
// import AuthService from "../services/auth.service";
// import { PostData } from "./PostData";
import { Redirect } from 'react-router-dom';


const required = value => {
    if (!value) {
        return (
            <div className="alert alert-danger" role="alert">
                This field is required!
            </div>
        );
    }
};

export default class Login extends Component {
    constructor(props) {
        super(props);
        this.handleLogin = this.handleLogin.bind(this);
        this.onChangeUsername = this.onChangeUsername.bind(this);
        this.onChangePassword = this.onChangePassword.bind(this);

        this.state = {
          username: "",
          password: "",
          loading: false,
          message: ""
        };
      }

      onChangeUsername(e) {
        this.setState({
          username: e.target.value
        });
      }

      onChangePassword(e) {
        this.setState({
          password: e.target.value
        });
      }

      handleLogin(e) {
        e.preventDefault();

        this.setState({
          message: "",
          loading: true
        });

        this.form.validateAll();

        if (this.checkBtn.context._errors.length === 0) {
          AuthService.login(this.state.username, this.state.password).then(
            () => {
              this.props.history.push("/profile");
              window.location.reload();
            },
                error => {
                    const resMessage =
                        (error.response &&
                            error.response.data &&
                            error.response.data.message) ||
                        error.message ||
                        error.toString();

                    this.setState({
                        loading: false,
                        message: resMessage
                    });
                }
            );
        } else {
            this.setState({
                loading: false
            });
        }
    }


    render() {

        const {loading} = this.state;

        // if (this.state.redirectToReferrer) {
        //     return (<Redirect to={'/dashboard'} />)
        // }

        // if (sessionStorage.getItem('token')) {
        //     return (<Redirect to={'/dashboard'} />)
        // }

        return (
            <div>
  {/*begin::Main*/}
  {/*begin::Header Mobile*/}
  <div id="kt_header_mobile" className="header-mobile bg-primary header-mobile-fixed">
    {/*begin::Logo*/}
    <a href="index.html">
      <img alt="Logo" src="assets/media/logos/logo-letter-9.png" className="max-h-30px" />
    </a>
    {/*end::Logo*/}
    {/*begin::Toolbar*/}
    <div className="d-flex align-items-center">
      <button className="btn p-0 burger-icon burger-icon-left ml-4" id="kt_header_mobile_toggle">
        <span />
      </button>
      <button className="btn p-0 ml-2" id="kt_header_mobile_topbar_toggle">
        <span className="svg-icon svg-icon-xl">
          {/*begin::Svg Icon | path:assets/media/svg/icons/General/User.svg*/}
